create table reclamos(
	idReclamo int not null identity,
	documento varchar(20) not null,
	codigo int not null,
	ubicacion varchar(300),
	descripcion varchar(1000),
	identificador int,
	constraint pk_reclamos primary key (idReclamo),
	constraint fk_raclamo_persona foreign key (documento) references personas,
	constraint fk_raclamo_edificio foreign key (codigo) references edificios
)

create table imagenes(
	numero int not null identity,
	path varchar(300) not null,
	tipo varchar(10),
	idReclamo int,
	constraint pk_imagenes primary key (numero),
	constraint fk_imagenes_reclamo foreign key (idReclamo) references reclamos
)
